import React, { Component } from 'react';
import { GoogleApiWrapper } from 'google-maps-react';

export class MapContainer extends Component {
  render() {
    return <div />;
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyBfGMaKy_LW8yj9bk-qOLs9MI-waCHIgWs',
})(MapContainer);
